import Typography from "@material-ui/core/Typography";
import React from "react";

export default function Copyright() {
    return (
        <Typography variant="body2" color="textSecondary">
            {'Copyright © '}

            <span>Artworch</span>{' '}

            {new Date().getFullYear()}
            {'.'}
        </Typography>
    );
}
